def get_libusb_backend():
    script_dir = os.path.dirname(os.path.abspath(__file__))
    lib_path = os.path.join(script_dir, 'libusb-1.0.dylib')
    if os.path.exists(lib_path):
        return usb.backend.libusb1.get_backend(find_library=lambda x: lib_path)
    return None


def run_driver(sequence_name):
    backend = get_libusb_backend()
    try:
        dev = usb.core.find(idVendor=VENDOR_ID, idProduct=PRODUCT_ID, backend=backend)
    except Exception:
        sys.exit(1)
    if dev is None:
        sys.exit(1)
    if dev.is_kernel_driver_active(W_INDEX):
        try:
            dev.detach_kernel_driver(W_INDEX)
        except usb.core.USBError:
            pass
    if sequence_name in SEQUENCES:
        for packet in SEQUENCES[sequence_name]:
            try:
                dev.ctrl_transfer(BM_REQUEST_TYPE, B_REQUEST, W_VALUE, W_INDEX, bytes(packet))
            except Exception:
                pass
            time.sleep(0.05)
    else:
        sys.exit(1)


if __name__ == "__main__":
    try:
        if len(sys.argv) > 1:
            run_driver(sys.argv[1])
        else:
            sys.exit(1)
    except Exception:
        sys.exit(1)
